import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (

      <div>
      <Scene
        style={{
          backgroundColor: 'blue'
        }}>
        <Text style={{
          transform:[{translate: [0, 0, -3]},{rotateX: '10deg'}],
          position:'absolute'
       }}>TEST</Text>
      </Scene>





      <div>
        Button
      </div>
      <div>
        Timer
      </div>
      <div>
        Results
      </div>
      </div>
    );
  }
}

export default App;
